import React from 'react';
import UsersList from '../components/UsersList';

const Users = () => {
    const USERS = [{
        id: 'u1', 
        name: 'michal', 
        image: 'https://lh6.googleusercontent.com/-Ws_m-ConuqI/AAAAAAAAAAI/AAAAAAAAAAA/yJVKiI7N47Q/photo.jpg?sz=32',
        songCount: 3
    }
    ];

    return <UsersList items={USERS} />;
};

export default Users;
